import logo from './logo.svg';
import './App.css';
import Nav from './Component/Nav';
import Header from './Component/Header';

function App() {
  return (
    <>
      <nav className="row vw flexJCC p1 shadow" >
        <div className="w80 col  flexAIC flexSB">
          <Nav />
          <Header/>
        </div>
      </nav>
    </>
  );
}

export default App;
